import { Component } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent {
  public eventos: any[] = [
    {
      tema: 'Angular 11 e .NET 5',
      local: 'Rio de Janeiro',
    },
    {
      tema: 'Angular e suas novidades',
      local: 'Espirito Santo',
    },
    {
      tema: 'Angular 16',
      local: 'Rio de Janeiro',
    },
  ]

  constructor() { }
  ngOnInit(): void { }
}
<h1>Eventos Components</h1>

<p><b>Tema: </b>{{ eventos[0].tema }} </p>
<p><b>Local:</b> {{ eventos[0].local }} </p>

<p><b>Tema: </b>{{ eventos[1].tema }} </p>
<p><b>Local: </b>{{ eventos[1].local }} </p>

<p><b>Tema: </b>{{ eventos[2].tema }} </p>
<p><b>Local: </b>{{ eventos[2].local }} </p>
